import React from 'react';
import { Dialog, Button, DialogActions } from '@material-ui/core/styles';
import { red } from '@material-ui/core/styles/colors';

const ShowDialog = ({
	open,
	onConfirmDialogClose,
	text,
	title = 'confirm',
	cancel,
	onYesClick,
}) => {
	return (
		<Dialog
			fullWidth={true}
			open={open}
			onClose={onConfirmDialogClose}>
			<div className="pt-24 px-20 pb-8">
				<h4>{title}</h4>
				{text}

				<DialogActions>
					<div className="flex flex-space-between flex-middle">
						<Button
							variant="contained"
							color="secondary"
							onClick={onConfirmDialogClose}>
							{cancel}
						</Button>
					</div>
				</DialogActions>
			</div>
		</Dialog>
	);
};

export default ShowDialog;
